import React, { Component } from 'react'

export default class TabPanel extends Comment {
    constructor(props) {
        super(props);
        this.state = {
            content: "Empty Content",
        };

        this.setState({ content: this.props.content })
    }

    render() {
        return (
            <div className="TabPanel">
                {this.state.content}
            </div>
        );
    }
};
